import React from 'react';

// import router
import {BrowserRouter, Route, Switch} from 'react-router-dom';

// import routes
import Landing from "./routes/Landing";

// universal stylings
import './css/App.css';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
        <Route path="/" exact render={(props) => <Landing routeLocation={"root"} {...props} />} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
